import React, {Component} from 'react';

class Home extends Component{

    getStyle = () => {
        return (
          float: right
        );

    }

    render(){
        return (
            <div>Home
                <ul>
                    <li style={{float:'right'}}>ABC</li>
                    <li style={{float:'right'}}>DEF</li>
                    <li style={{float:'right'}}>GHI</li>
                </ul>
            </div>
        );
    }
}

export default Home;
